import { Button } from "primereact/button";

const EditButton = ({ action, icon, labelText }) => {
  return (
    <Button
    label={labelText?labelText:undefined}
    icon={`pi pi-${icon}`}
    className="delete-button p-button-rounded p-button-warning mt-2"
    onClick={() => action()}
    />
  );
};

export default EditButton;
